import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <Container fluid className="home-about-section" style={{ backgroundColor: '#313131'}}>
      <Container>
        <Row>
          <Col md={12} className="home-about-description">
            <h1 style={{ fontSize: '2.6em', color: '#fff', marginBottom: 50 }}> People who are <br />ready took these courses!</h1>
            <Link to="#" className="Button-white" style={{textAlign: 'center'}}>Request Demo</Link>
          </Col>
        </Row>
      </Container>
    </Container>
  );
}

export default Footer;
